import { Routes, Route } from "react-router-dom";
import NavBar from "./Pages/Navbar";
function App() {
  return (
    <div className="flex flex-col bg-primary">
      <NavBar />
      <Routes>
          <Route path="/login" element={<Login />} />


        </Routes>
    </div>
  );
}

export default App;
